import logging
from datetime import datetime
from typing import List, Dict, Optional
from enum import Enum

# Enhanced logging setup
logging.basicConfig(
    level=logging.INFO,
    format='%(asctime)s - %(name)s - %(levelname)s - %(message)s',
    handlers=[
        logging.FileHandler('broker.log'),
        logging.StreamHandler()
    ]
)
logger = logging.getLogger(__name__)

class PublishStatus(Enum):
    DRAFT = "draft"
    PUBLISHED = "published"
    PENDING = "pending"
    FAILED = "failed"

class Submission:
    def __init__(self, submission_id: str, agency: str, publish_status: PublishStatus = PublishStatus.DRAFT):
        self.submission_id = submission_id
        self.agency = agency
        self.publish_status = publish_status
        self.created_at = datetime.now()
        self.updated_at = datetime.now()
        self.validation_errors: List[str] = []
        self.flex_fields: Dict[str, str] = {}

    def update_publish_status(self, new_status: PublishStatus):
        self.publish_status = new_status
        self.updated_at = datetime.now()
        logger.info(f"Submission {self.submission_id} status updated to {new_status.value}")

    def add_validation_error(self, error: str):
        self.validation_errors.append(error)
        logger.warning(f"Validation error added to submission {self.submission_id}: {error}")

    def get_validation_errors(self) -> List[str]:
        return self.validation_errors

    def add_flex_field(self, key: str, value: str):
        self.flex_fields[key] = value
        logger.debug(f"Flex field {key} added to submission {self.submission_id}")

class FABSSubmission(Submission):
    def __init__(self, submission_id: str, agency: str):
        super().__init__(submission_id, agency)
        self.file_path: Optional[str] = None
        self.is_historical: bool = False

    def upload_file(self, file_path: str):
        self.file_path = file_path
        logger.info(f"File uploaded for submission {self.submission_id}: {file_path}")

    def validate(self) -> bool:
        if not self.file_path:
            self.add_validation_error("No file uploaded")
            return False
        # Simulate validation logic
        if "invalid" in self.file_path:
            self.add_validation_error("Invalid file format")
            return False
        return True

    def publish(self) -> bool:
        if self.publish_status != PublishStatus.DRAFT:
            logger.error(f"Submission {self.submission_id} is not in draft status")
            return False
        self.update_publish_status(PublishStatus.PENDING)
        # Simulate publishing logic
        if self.validate():
            self.update_publish_status(PublishStatus.PUBLISHED)
            return True
        else:
            self.update_publish_status(PublishStatus.FAILED)
            return False

class DABSSubmission(Submission):
    def __init__(self, submission_id: str, agency: str):
        super().__init__(submission_id, agency)
        self.fpds_data: Dict[str, str] = {}

    def sync_with_fpds(self, fpds_data: Dict[str, str]):
        self.fpds_data = fpds_data
        self.updated_at = datetime.now()
        logger.info(f"FPDS data synced for submission {self.submission_id}")

    def generate_d_file(self) -> str:
        if not self.fpds_data:
            self.add_validation_error("No FPDS data available")
            return ""
        # Simulate D file generation
        return f"D_file_{self.submission_id}.csv"

class UIDesigner:
    def __init__(self, name: str):
        self.name = name

    def redesign_page(self, page_name: str) -> bool:
        logger.info(f"{self.name} is redesigning {page_name}")
        return True

    def conduct_user_testing(self, test_plan: str) -> Dict[str, str]:
        logger.info(f"{self.name} is conducting user testing for {test_plan}")
        return {"feedback": "Positive", "issues": []}

    def schedule_user_testing(self, date: datetime) -> bool:
        logger.info(f"{self.name} scheduled user testing for {date}")
        return True

class DevOpsEngineer:
    def __init__(self, name: str):
        self.name = name

    def configure_new_relic(self, apps: List[str]) -> bool:
        logger.info(f"{self.name} configured New Relic for {len(apps)} applications")
        return True

class AgencyUser:
    def __init__(self, name: str, agency: str):
        self.name = name
        self.agency = agency

    def submit_data(self, submission: Submission) -> bool:
        logger.info(f"{self.name} from {self.agency} submitted data {submission.submission_id}")
        return submission.publish()

    def get_file_level_errors(self, submission: Submission) -> List[str]:
        return submission.get_validation_errors()

class DataUser:
    def __init__(self, name: str):
        self.name = name

    def receive_updates(self, submission: Submission) -> bool:
        logger.info(f"{self.name} received updates for {submission.submission_id}")
        return True

# Example usage
if __name__ == "__main__":
    # Create a FABS submission
    fabs_sub = FABSSubmission("FABS123", "NASA")
    fabs_sub.upload_file("valid_file.csv")
    fabs_sub.publish()

    # Create a UI designer
    ui_designer = UIDesigner("Alice")
    ui_designer.redesign_page("Resources")
    ui_designer.conduct_user_testing("Homepage edits")

    # Create an agency user
    agency_user = AgencyUser("Bob", "NASA")
    agency_user.submit_data(fabs_sub)
